    // screen elements extra js


    function Follow2Page_elementsExtraJS() {
        // screen (Follow2Page) extra code

        /* mobilecollapsblock_5 */

        $("#Follow2Page_mobilecollapsblock_5 .ui-collapsible-heading-toggle").attr("tabindex", "2");

        /* gmap2 */

        $("[name = 'gmap2']").wrap("<div/>");
        $("[name = 'gmap2']").parent().css("margin-left", $("[name = 'gmap2']").css("margin-left"));
        $("[name = 'gmap2']").parent().css("margin-right", $("[name = 'gmap2']").css("margin-right"));
        $("[name = 'gmap2']").css("margin-left", '0');
        $("[name = 'gmap2']").css("margin-right", '0');

        var gmap2_options = {
            markerSourceName: "gmap2_markers",
            latitude: "",
            longitude: "",
            address: "Saudi Arabia",
            zoom: 7,
            showLocationMarker: false
        }

        Apperyio.__registerComponent('gmap2', new Apperyio.ApperyMapComponent("gmap2", gmap2_options));
        $("[name='gmap2_markers'] [apperytype='marker']").attr("reRender", "gmap2");

        function __update_gmap2(event, ui) {
            if (($('#Follow2Page_gmap2', ui.toPage).length > 0) && (Apperyio('gmap2') != undefined) && (Apperyio('gmap2').isInitialized)) {
                Apperyio('gmap2').refresh();
            }
        }
        $(":mobile-pagecontainer").off("pagecontainershow.Follow2Page_mobilecontainer", __update_gmap2).on("pagecontainershow.Follow2Page_mobilecontainer", __update_gmap2);

        /* mobilecollapsblock_206_230 */

        $("#Follow2Page_mobilecollapsblock_206_230 .ui-collapsible-heading-toggle").attr("tabindex", "12");

    };

